import React from 'react';
import Header from './Header';
import Meta from './Meta';
import styled from 'styled-components';

const MyButton = styled.button`
  background: red;
  font-size: 100px;
`;

const Page = props => {
  return (
    <div>
      <Meta />
      <Header />
      <MyButton>Click Me</MyButton>
      {props.children}
    </div>
  )
};

export default Page;
